question_text:
      В дадения по-долу фрагмент от програмен код какво трябва да пише на мястото на '?' в случай на успех, тоест каква стойност трябва да има req.status?
function getFile(myCallback) {
        let req = new XMLHttpRequest();
        req.open('GET', "mycar.html");
        req.onload = function() {
          if (req.status == ?) {
            myCallback(this.responseText);
          } else {
            myCallback("Error: " + req.status);
          }
        }
        req.send();
      }
